	private void CbButtons_SelectedIndexChanged(object sender, EventArgs e)
	{
		int selectedIndex = CbDefaultButton.get_SelectedIndex();
		CbDefaultButton.get_Items().Clear();
		CbDefaultButton.get_Items().Add((object)"Button 1");
		if (CbButtons.get_SelectedIndex() != 0)
		{
			CbDefaultButton.get_Items().Add((object)"Button 2");
		}
		if ((CbButtons.get_SelectedIndex() == 2) | (CbButtons.get_SelectedIndex() == 3))
		{
			CbDefaultButton.get_Items().Add((object)"Button 3");
		}
		if (selectedIndex > checked(CbDefaultButton.get_Items().get_Count() - 1))
		{
			CbDefaultButton.set_SelectedIndex(0);
		}
		else
		{
			CbDefaultButton.set_SelectedIndex(selectedIndex);
		}
	}

