	public string GenerateCode()
	{
		string text = "MessageBox.Show(";
		if (!string.IsNullOrEmpty(TbOwner.get_Text()))
		{
			text = text + TbOwner.get_Text() + ", ";
		}
		text = text + "\"" + TbText.get_Text() + "\", \"" + TbCaption.get_Text() + "\"";
		switch (CbButtons.get_SelectedIndex())
		{
		case 0:
			text += ", MessageBoxButtons.OK";
			break;
		case 1:
			text += ", MessageBoxButtons.OKCancel";
			break;
		case 2:
			text += ", MessageBoxButtons.AbortRetryIgnore";
			break;
		case 3:
			text += ", MessageBoxButtons.YesNoCancel";
			break;
		case 4:
			text += ", MessageBoxButtons.YesNo";
			break;
		case 5:
			text += ", MessageBoxButtons.RetryCancel";
			break;
		}
		if (RbInformation.get_Checked())
		{
			text += ", MessageBoxIcon.Information";
		}
		else if (RbWarning.get_Checked())
		{
			text += ", MessageBoxIcon.Warning";
		}
		else if (RbError.get_Checked())
		{
			text += ", MessageBoxIcon.Error";
		}
		else if (RbQuestion.get_Checked())
		{
			text += ", MessageBoxIcon.Question";
		}
		else if (RbNone.get_Checked())
		{
			text += ", MessageBoxIcon.None";
		}
		switch (CbButtons.get_SelectedIndex())
		{
		case 0:
			text += ", MessageBoxDefaultButton.Button1";
			break;
		case 1:
			text += ", MessageBoxDefaultButton.Button2";
			break;
		case 2:
			text += ", MessageBoxDefaultButton.Button3";
			break;
		}
		return text + ")";
	}
